Anyone can create a new Kiosk in a single transaction by calling the kiosk::default function. It will create and share a Kiosk and transfer the KioskOwnerCap to the transaction sender. Example Kiosk SDK import { createKioskAndShare } from '@mysten/kiosk'; let txb = new TransactionBuilder();
let kioskOwnerCap = createKioskAndShare(txb); txb.transferObjects([ kioskOwnerCap ], tx.pure(sender, 'address')); Example PTB let txb = new TransactionBuilder();
txb.moveCall({ target: '0x2::kiosk::default'
}); Example CLI sui client call \ --package 0x2 \ --module kiosk \ --function default \ --gas-budget 1000000000

